func (c *current) onSelectOrCall1(left, name, args any) (any, error) {
	if args != nil {
		// Select followed by () - add Args field
		argRecord := Record(args.([]Keyed[Node]))
		return Select{
			Receiver: left.(Node),
			Field:    name.(string),
			Args:     &argRecord,
			Loc:      c.Loc(),
		}, nil
	} else {
		// Just a Select
		return Select{
			Receiver: left.(Node),
			Field:    name.(string),
			Args:     nil,
			AutoCall: true,
			Loc:      c.Loc(),
		}, nil
	}
}

